class Solution:
    def countSpecialSubsequences(self, nums: List[int]) -> int:
        n = len(nums)
        
        def dfs(cur, pos):
            if (cur, pos) in mem:
                return mem[(cur, pos)]

            if pos == n:
                if cur == 3:
                    return 1
                return 0

            cnt = 0

            if cur == 3:
                cnt = 1
        
            for i in range(pos, n):
                if nums[i] == cur:
                    cnt += dfs(cur + 1, i + 1)
                    cnt += dfs(cur, i + 1)
            
            mem[(cur, pos)] = cnt
            return cnt
    
        mem = {}
        ret = dfs(0, 0)
        return ret%(10**9 + 7)

    def countSpecialSubsequences(self, nums: List[int]) -> int:
        dp = [1, 0, 0, 0]

        for num in nums:
            dp[num + 1] += dp[num] + dp[num + 1]

        return dp[-1]%(10**9 + 7)


